import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Card(props) {
  return (
    <div className="comments-card">
      <div className="head">
        <span>00:00:00</span>
        <span className="grey">|</span>
        <span className="grey ellipsis text">Watch a free video course on Vue Mastery</span>
      </div>
      <div className="middle clearfix">
        <div className="left">
          <span className="avatar"></span>
        </div>
        <div className="right">
          <div>Name</div>
          <div className="grey">1mins ago</div>
        </div>
      </div>
      <div className="info clearfix ellipsis_3">The official guide assumes intermediate level knowledge of HTML, CSS, and JavaScript. If you are totally new to frontend development, it might not be the best idea to jump right into a framework as your first step - grasp the basics then come back! Prior experience with other frameworks helps, but is not required.</div>
    </div>
  );
}

